import './App.css';

function Header() {
  return(
    <div class="navbar">
      <div class="flex-1">
        <h2>My Poca Wishlist Maker</h2>
      </div>
      <div className="flex-non">
        <ul class="menu menu-horizontal px-1"> 
          <li>Items</li>
          <li>Wishlists</li>
        </ul>
      </div>
      

    </div>
  ) 
}

function App() {
  return(
    <div>
      <Header />
    </div>
  )
 
}

export default App;
